import React from 'react';
import CuadroClasificacion from '../componentes/CuadroClasificacion';
import CalendarioPartidos from './componentes/CalendarioPartidos';

const Home = () => {
  // Ejemplo de datos de clasificación
  const matches = {
    quartos: [
      { team1: 'Argentina', score1: 4, team2: 'Ecuador', score2: 1 },
      { team1: 'Venezuela', score1: 1, team2: 'Canadá', score2: 4 },
      // Otros partidos de cuartos de final
    ],
    semifinales: [
      { team1: 'Argentina', score1: 2, team2: 'Canadá', score2: 0 },
      // Otro partido de semifinales
    ],
    final: { team1: 'Argentina', score1: 1, team2: 'Colombia', score2: 0 }
  };

  // Ejemplo de calendario de partidos
  const schedule = [
    {
      date: '20/06',
      matches: [
        { group: 'Grupo A', team1: 'Argentina', team2: 'Canadá', score1: 2, score2: 0, status: 'Terminado' },
        // Otros partidos del día
      ]
    },
    // Otros días de calendario
  ];

  return (
    <div>
      <CuadroClasificacion matches={matches} />
      <CalendarioPartidos schedule={schedule} />
    </div>
  );
};

export default Home;
